package site.nicezo.dto;

public class CourseGallery {
	private int courseGalleryId;
	private String courseGalleryCourseName;
	private int courseGalleryHoleNo;
	private String courseGalleryPicture;
	
	public CourseGallery() {
		// TODO Auto-generated constructor stub
	}

	public int getCourseGalleryId() {
		return courseGalleryId;
	}

	public void setCourseGalleryId(int courseGalleryId) {
		this.courseGalleryId = courseGalleryId;
	}

	public String getCourseGalleryCourseName() {
		return courseGalleryCourseName;
	}

	public void setCourseGalleryCourseName(String courseGalleryCourseName) {
		this.courseGalleryCourseName = courseGalleryCourseName;
	}

	public int getCourseGalleryHoleNo() {
		return courseGalleryHoleNo;
	}

	public void setCourseGalleryHoleNo(int courseGalleryHoleNo) {
		this.courseGalleryHoleNo = courseGalleryHoleNo;
	}

	public String getCourseGalleryPicture() {
		return courseGalleryPicture;
	}

	public void setCourseGalleryPicture(String courseGalleryPicture) {
		this.courseGalleryPicture = courseGalleryPicture;
	}
	
}
